import React from "react";
import { Link } from "@mui/material";
import CreditScoringCard from "./CreditScoringCard";

const CreditScoringList  = () => {
  const [showCreditScoringCard, setShowOtherComponent] = useState(false);

  const handleButtonClick = () => {
    setShowOtherComponent(true);
  };
  return (
    <div className="table-container"> {/* Add a container with a class for margin */}
        <button onClick={handleButtonClick}>Show Other Component</button>
      {showCreditScoringCard && <CreditScoringCard />}
      <table className="table">
        <thead>
          <tr>
            <th className="text-center">#</th>
            <th>Name</th>
            <th>Version</th>
            <th>Created Date</th>
            <th className="text-right">Approved Date</th>
            <th className="text-right">Status</th>
            <th className="text-right">Actions</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td className="text-center">1</td>
          </tr>
          <tr>
            <td className="text-center">2</td>
          </tr>
          <tr>
            <td className="text-center">3</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default CreditScoringList ;
